-- 表结构导出
DROP TABLE IF EXISTS `fact_powerstation`;
CREATE TABLE `fact_powerstation` (
  `fact_id` bigint NOT NULL AUTO_INCREMENT,
  `country_id` int DEFAULT NULL,
  `location_id` int DEFAULT NULL,
  `status_id` int DEFAULT NULL,
  `tech_type_id` int DEFAULT NULL,
  `coal_type_id` int DEFAULT NULL,
  `start_date_id` int DEFAULT NULL,
  `retire_date_id` int DEFAULT NULL,
  `plant_name` varchar(255) NOT NULL,
  `capacity` int DEFAULT NULL COMMENT '装机容量(MW)',
  `annualCarbon` decimal(10,2) DEFAULT NULL COMMENT '年碳排放量(百万吨)',
  `start_year1` int DEFAULT NULL,
  `start_year2` int DEFAULT NULL,
  `retire_year1` int DEFAULT NULL,
  `retire_year2` int DEFAULT NULL,
  `retire_year3` int DEFAULT NULL,
  `data_year1` int DEFAULT NULL,
  `data_year2` int DEFAULT NULL,
  `start_label` varchar(200) DEFAULT NULL,
  `original_id` int DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted_at` datetime DEFAULT NULL,
  PRIMARY KEY (`fact_id`),
  KEY `idx_fact_country` (`country_id`),
  KEY `idx_fact_location` (`location_id`),
  KEY `idx_fact_status` (`status_id`),
  KEY `idx_fact_tech` (`tech_type_id`),
  KEY `idx_fact_coal` (`coal_type_id`),
  KEY `idx_fact_capacity` (`capacity`),
  KEY `idx_fact_carbon` (`annualCarbon`),
  KEY `idx_fact_original` (`original_id`),
  KEY `idx_fact_deleted` (`deleted_at`),
  CONSTRAINT `fact_powerstation_ibfk_1` FOREIGN KEY (`country_id`) REFERENCES `dim_country` (`country_id`),
  CONSTRAINT `fact_powerstation_ibfk_2` FOREIGN KEY (`location_id`) REFERENCES `dim_location` (`location_id`),
  CONSTRAINT `fact_powerstation_ibfk_3` FOREIGN KEY (`status_id`) REFERENCES `dict_powerstation_status` (`status_id`),
  CONSTRAINT `fact_powerstation_ibfk_4` FOREIGN KEY (`tech_type_id`) REFERENCES `dict_powerstation_tech_type` (`tech_type_id`),
  CONSTRAINT `fact_powerstation_ibfk_5` FOREIGN KEY (`coal_type_id`) REFERENCES `dict_coal_type` (`coal_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8192 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='电站事实表';

